import api from '../infra/api-config'

export function getUserRepos(user){
    const url = `/users/${user}/repos`
    return api().get(url)
}
export function getRepoCommits({user,repo}){
    const url = `/repos/${user}/${repo}/commits`
    console.log('url',url)
    return api().get(url)
}
